const Heromenu = () => {
	return (
		<div>
			<div class="jumbotron jumbotron-fluid">
				<div class="container">
					<h1 class="display-4">Nama Restoran</h1>
					<p class="lead"></p>
				</div>
			</div>
		</div>
	);
};

export default Heromenu;
